.fr','system.menu.tools',_binary 'a:2:{s:5:\"label\";s:6:\"Outils\";s:11:\"description\";s:63:\"Liens outils de l\'utilisateur, souvent ajouts par des modules\";}'),('language.fr','taxonomy.vocabulary.tags',_binary 'a:2:{s:4:\"name\";s:11:\"tiquettes\";s:11:\"description\";s:100:\"Utilisez les tiquettes pour regrouper les articles sur des sujets similaires dans des catgories.\";}'),('language.fr','tour.tour.block-layout',_binary 'a:2:{s:5:\"label\";s:28:\"Page de Mise en page du Bloc\";s:4:\"tips\";a:4:{s:12:\"block-layout\";a:2:{s:5:\"label\";s:20:\"Mise en page du Bloc\";s:4:\"body\";s:150:\"Les blocs sont des botes de contenu qui peuvent tre affiches dans des rgions (telles que le pied de page ou la barre latrale) de votre page.\";}s:11:\"place-block\";a:2:{s:5:\"label\";s:16:\"Placer des blocs\";s:4:\"body\";s:213:\"Tout bloc personnalis ou contribu peut tre ajout  une rgion particulire en cliquant sur un bouton Positionner un bloc. Un nouveau bloc peut galement tre cr en cliquant sur Positionner un bloc\";}s:12:\"block-region\";a:2:{s:5:\"label\";s:15:\"Rgion du Bloc\";s:4:\"body\";s:172:\"Assigner ou changer la rgion d\'un bloc en cliquant ici. Une liste droulante avec toutes les rgions apparatra. Vous pouvez placer un bloc dans de multiples rgions.\";}s:15:\"configure-block\";a:2:{s:5:\"label\";s:18:\"Configurer le bloc\";s:4:\"body\";s:162:\"En cliquant sur Configurer, vous pouvez modifier le contenu du bloc, grer ses paramtres de visibilit et mme changer son emplacement dans votre thme.\";}}}'),('language.fr','tour.tour.language',_binary 'a:2:{s:5:\"label\";s:6:\"Langue\";s:4:\"tips\";a:6:{s:17:\"language-overview\";a:2:{s:5:\"label\";s:7:\"Langues\";s:4:\"body\";s:113:\"<p>La page \"Langues\" vous permet d\'ajouter, de modifier, de supprimer et rordonner les langues sur le site.</p>\";}s:12:\"language-add\";a:2:{s:5:\"label\";s:16:\"Ajout de langues\";s:4:\"body\";s:219:\"<p>Pour ajouter plus de langues  votre site, cliquer sur le bouton \"Ajouter une langue\".</p><p>Les langues ajoutes seront affiches dans la liste des langues et pourront ensuite tre modifies ou supprimes.</p>\";}s:16:\"language-reorder\";a:2:{s:5:\"label\";s:23:\"Rordonner les langues\";s:4:\"body\";s:456:\"<p>Pour rordonner les langues sur votre site, utilisez les icnes  ct de chaque langue.</p><p>L\'ordre affich ici est l\'ordre d\'affichage pour les listes de langue sur le site telles que le bloc de changement de langue fourni par les modules Interface Translation et Content Translation.</p><p>Lorsque vous avez termin de rordonner les langues, cliquer sur le bouton \"Enregistrer la configuration\" pour que les changements prennent effet.</p>\";}s:16:\"language-default\";a:2:{s:5:\"label\";s:31:\"Dfinir une langue par dfaut\";s:4:\"body\";s:289:\"<p>Vous pouvez changer la langue par dfaut de votre site en choisissant une des langues configures. Le site utilisera cette langue par dfaut dans les cas o aucun choix n\'a t fait mais que la langue doit tre dfinie, par exemple pour la langue d\'affichage de l\'interface.</p>\";}s:19:\"language-operations\";a:2:{s:5:\"label\";s:19:\"Modifie les langues\";s:4:\"body\";s:434:\"<p>Les actions pour diter et supprimer vos langues sont fournies.</p><p>Vous pouvez modifier le nom et le sens de lecture de la langue.</p><p>Les langues supprimes peuvent tre r-ajoutes plus tard. Supprimer une langue retirera toutes les traductions d\'interface associes et le contenu dans cette langue sera marqu comme indpendant de la langue. Notez que vous ne pouvez pas supprimer la langue par dfaut du site.</p>\";}s:17:\"language-continue\";a:2:{s:5:\"label\";s:14:\"Continuant sur\";s:4:\"body\";s:285:\"<p>Maintenant que vous avez une vue d\'ensemble de la page \"Langues\", vous pouvez continuer par :<ul><li><a href=\"[site:url]admin/config/regional/language/add\">Ajouter une langue</a></li><li>Rorganiser les langues</li><li>Modifier une langue</li><li>Supprimer une langue</li></ul></p>\";}}}'),('language.fr','tour.tour.language-add',_binary 'a:2:{s:5:\"label\";s:16:\"Ajout de langues\";s:4:\"tips\";a:3:{s:21:\"language-add-overview\";a:2:{s:5:\"label\";s:16:\"Ajout de langues\";s:4:\"body\";s:185:\"<p>Cette page donne la possibilit d\'ajouter des langues communes sur votre site.</p><p>Si la langue souhaite n\'est pas disponible, vous pouvez ajouter une langue personnalise.</p>\";}s:19:\"language-add-choose\";a:2:{s:5:\"label\";s:21:\"Choisissez une langue\";s:4:\"body\";s:342:\"<p>Choisir une langue dans la liste ou choisir \"Langue personnalise...\"  la fin de la liste.</p><p>Cliquer sur le bouton \"Ajouter une langue\" lorsque votre langue est choisie.</p><p>Lors de l\'ajout d\'une langue personnalise, un formulaire supplmentaire vous demandera d\'indiquer le nom, le code et le sens de lecture de la langue.</p>\";}s:21:\"language-add-continue\";a:2:{s:5:\"label\";s:14:\"Continuant sur\";s:4:\"body\";s:301:\"<p>Maintenant que vous avez une vue d\'ensemble de la fonctionnalit \"Ajouter des langues\", vous pouvez continuer par :\r\n <ul><li>Ajouter une langue</li><li>Ajouter une langue personnalise</li><li><a href=\"[site:url]admin/config/regional/language\">Afficher les langues configures</a></li></ul></p>\";}}}'),('language.fr','tour.tour.language-edit',_binary 'a:2:{s:5:\"label\";s:24:\"Modification des langues\";s:4:\"tips\";a:5:{s:22:\"language-edit-overview\";a:2:{s:5:\"label\";s:24:\"Modification des langues\";s:4:\"body\";s:117:\"<p> Cette page donne la possibilit de modifier une langue sur votre site, y compris les langues personnalises</p>\";}s:22:\"language-edit-langcode\";a:2:{s:5:\"label\";s:17:\"Code de la langue\";s:4:\"body\";s:145:\"<p>Vous ne pouvez pas changer le code d\'une langue du site, ds lors qu\'elle est utilise par le systme pour garder trace de cette langue</p>\";}s:19:\"language-edit-label\";a:2:{s:5:\"label\";s:16:\"Nom de la langue\";s:4:\"body\";s:358:\"<p>Le nom de la langue est utilis  travers le site pour tous les utilisateurs et est crite en anglais. Les noms des langues prdfinies peuvent tre traduites en utilisant le module Interface Translation et les noms des langues prdfinies et des langues personnalises peuvent tre traduits en utilisant le module Configuration Translation.</p>\";}s:23:\"language-edit-direction\";a:2:{s:5:\"label\";s:22:\"Direction de la langue\";s:4:\"body\";s:237:\"<p>Choisir si la langue se lit \"de gauche  droite\" ou \"de droite  gauche\".</p><p>Notez que tous les thmes ne supportent pas la mise en page \"de droite  gauche\" alors testez votre thme si vous utilisez \"de droite  gauche\".</p>\";}s:22:\"language-edit-continue\";a:2:{s:5:\"label\";s:14:\"Continuant sur\";s:4:\"body\";s:258:\"<p>Maintenant que vous avez une vue d\'ensemble de la fonctionnalit \"Modifier une langue\", vous pouvez continuer par : <ul><li>Modifier une langue</li><li><a href=\"[site:url]admin/config/regional/language\">Afficher les langues configures</a></li></ul></p>\";}}}'),('language.fr','tour.tour.locale',_binary 'a:2:{s:5:\"label\";s:10:\"Traduction\";s:4:\"tips\";a:8:{s:15:\"locale-overview\";a:2:{s:5:\"label\";s:37:\"Traduction de l\'interface utilisateur\";s:4:\"body\";s:315:\"Cette page vous permet de traduire l\'interface utilisateur ou de modifier des traductions existantes. Si vous avez install votre site initialement en anglais, vous devez d\'abord ajouter une autre langue dans la <a href=\"[site:url]admin/config/regional/language\"> page des Langues </a>, afin d\'utiliser cette page.\";}s:15:\"locale-language\";a:2:{s:5:\"label\";s:20:\"Langue de traduction\";s:4:\"body\";s:46:\"Choisir la langue que vous souhaitez traduire.\";}s:13:\"locale-search\";a:2:{s:5:\"label\";s:10:\"Rechercher\";s:4:\"body\";s:121:\"Saisir le mot ou la phrase prcise que vous souhaitez traduire, vous pouvez aussi crire seulement une partie d\'un mot.\";}s:13:\"locale-filter\";a:2:{s:5:\"label\";s:20:\"Filtrer la recherche\";s:4:\"body\";s:223:\"Vous pouvez chercher les chanes non traduites si vous voulez traduire quelque chose qui n\'a pas encore t traduit. Si vous voulez modifier une traduction existante, vous pouvez ne rechercher que les chanes traduites.\";}s:13:\"locale-submit\";a:2:{s:5:\"label\";s:36:\"Appliquer vos critres de recherche\";s:4:\"body\";s:82:\"Pour appliquer vos critres de recherche, cliquer sur le bouton <em>Filtrer</em>.\";}s:16:\"locale-translate\";a:2:{s:5:\"label\";s:8:\"Traduire\";s:4:\"body\";s:190:\"Vous pouvez crire votre propre traduction dans les champs texte de la colonne de droite. Essayez de savoir dans quel contexte le texte sera utilis pour le traduire de faon approprie.\";}s:15:\"locale-validate\";a:2:{s:5:\"label\";s:21:\"Valider la traduction\";s:4:\"body\";s:225:\"Lorsque vous avez termin vos traductions, cliquer sur le bouton <em>Enregistrer vos traductions</em>. Vous devez enregistrer vos traductions  chaque fois que vous souhaitez changer de page ou faire une nouvelle recherche.\";}s:15:\"locale-continue\";a:2:{s:5:\"label\";s:14:\"Continuant sur\";s:4:\"body\";s:407:\"Les traductions que vous avez faites ici seront utilises sur l\'interface utilisateur de votre site. Si vous souhaitez les utiliser sur un autre site ou les modifier sur un diteur de traduction externe, vous pouvez les <a href=\"[site:url]admin/config/regional/translate/export\"> exporter </a> vers un fichier .po et les <a href=\"[site:url]admin/config/regional/translate/import\"> importer </a> plus tard.\";}}}'),('language.fr','tour.tour.views-ui',_binary 'a:2:{s:5:\"label\";s:28:\"Voir la page de modification\";s:4:\"tips\";a:10:{s:10:\"views-main\";a:2:{s:5:\"label\";s:34:\"Grer les paramtres d\'affichage\";s:4:\"body\";s:34:\"Voir ou modifier la configuration.\";}s:17:\"views-ui-displays\";a:2:{s:5:\"label\";s:24:\"S\'affiche dans cette vue\";s:4:\"body\";s:198:\"Un affichage est une faon de rendre les rsultats, par exemple comme une page ou un bloc. Une vue peut contenir plusieurs affichages, qui sont lists ici. L\'affichage actif est mis en vidence.\";}s:19:\"views-ui-view-admin\";a:2:{s:5:\"label\";s:21:\"Voir l\'administration\";s:4:\"body\";s:157:\"Raliser des tches d\'administration, comme ajouter une description et crer un clone. Cliquer sur le bouton droulant pour voir les options disponibles.\";}s:15:\"views-ui-format\";a:2:{s:5:\"label\";s:16:\"Format de sortie\";s:4:\"body\";s:419:\"Choisir comment afficher les rsultats. Par ex., choisir <em>Contenu</em> pour afficher chaque lment dans son intgralit, utilisant vos paramtres d\'affichage. Ou choississez <em>Champs</em>, qui permet de n\'afficher que les champs slectionns pour chaque rsultat. Des formats supplmentaires peuvent tre ajouts en installant des modules qui <em>tendent</em> les fonctionnalits de base de Drupal.\";}s:15:\"views-ui-fields\";a:2:{s:5:\"label\";s:6:\"Champs\";s:4:\"body\";s:113:\"Si cette vue utilise des champs, alors ils sont lists ici. Vous pouvez cliquer sur un champ pour le configurer.\";}s:15:\"views-ui-filter\";a:2:{s:5:\"label\";s:17:\"Filtrer votre vue\";s:4:\"body\";s:203:\"Ajouter des filtres pour limiter le nombre de rsultats affichs. Par ex., pour ne montrer que le contenu <em>publi</em>, il faudrait ajouter le filtrer <em>Publi</em> et selectionner <em>Oui</em>.\";}s:26:\"views-ui-filter-operations\";a:2:{s:5:\"label\";s:19:\"Filtrer les actions\";s:4:\"body\";s:46:\"Ajouter, rarranger ou supprimer les filtres.\";}s:14:\"views-ui-sorts\";a:2:{s:5:\"label\";s:15:\"Critre de tri\";s:4:\"body\";s:122:\"Contrler l\'ordre dans lequel les rsultats sont affichs. Cliquer sur une une rgle de tri active pour la configurer.\";}s:25:\"views-ui-sorts-operations\";a:2:{s:5:\"label\";s:17:\"Trier les actions\";s:4:\"body\";s:53:\"Ajouter, rarranger ou supprimer les rgles de tri.\";}s:16:\"views-ui-preview\";a:2:{s:5:\"label\";s:7:\"Aperu\";s:4:\"body\";s:43:\"Afficher un aperu du rsultat de la vue.\";}}}'),('language.fr','user.mail',_binary 'a:9:{s:14:\"cancel_confirm\";a:2:{s:7:\"subject\";s:66:\"Demande d\'annulation du compte [user:display-name] sur [sit